import { Component } from '@angular/core';
import { UserService } from '../service/user.service';
import { AdminService } from '../service/admin.service';
import { CreateVet } from '../model/create-vet.model';

@Component({
  selector: 'app-create-vaccine',
  templateUrl: './create-vaccine.component.html',
  styleUrls: ['./create-vaccine.component.css']
})
export class CreateVaccineComponent {
  public vet : CreateVet = new CreateVet();

  constructor(private userService: UserService, private adminService: AdminService) { }

  ngOnInit(): void {
    console.log(localStorage.getItem('token'));

  }

  public getDate(): string {
    let date = new Date();
    let day = date.getDate();
    let month = date.getMonth() + 1;
    let year = date.getFullYear();
    return `${year}-${month < 9 ? ('0'+month) : month}-${day < 9 ? ('0'+day) : day}`;
  }

  register(){
    this.adminService.registerVet(this.vet).subscribe((response: any) => {
      console.log(response)

      alert('Successfully registered');
      // window.location.href = '/register-vet'

    },
    (error) => {
      alert("Invalid registration");
      console.log(error);
    });
  }
}
